// boootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
// helmet
import {Helmet} from 'react-helmet';

// components
import './App.css';
import Navbars from './Component/Nav/Navbars';
import Footer from './Component/Footer/Footer'
import Home from './Component/Home/Home'

<Helmet>
<meta charSet="utf-8" />
<title>Tony River'a Full-Stack</title>
<link rel="canonical" href="/" />
<meta name="description" content="Tony River'a Full-Stack" />
</Helmet>

function App() {
  return (
  <router>
    <div className="App">
    <div className="p-24 transition duration-300 shadow-lg rounded-blob absolute transform -translate-x-5 -translate-y-20 lg:-translate-x-10 lg:-translate-y-10 bg-gradient-to-b from-red-500 via-green-400 to-blue-900"></div>
    <div className="flex items-center lg:mb-20 justify-between">
      <nav>
        <Navbars /> 
      </nav>
      <div>
      <Home />
      </div>

        <footer>
          <Footer />
        </footer>
    </div>
  </div>
</router>
  );
}

export default App;
